<script>
var outpost_color = "#E74C3C";
function switchOutpostColor(clicked_button) {
	outpost_color = window.getComputedStyle(document.getElementById(clicked_button), null).getPropertyValue("border-color");
}
function cycleOutpost(clicked_system) {
	if (document.getElementById(clicked_system).getAttribute('current-outpost') == "none") {
		document.getElementById(clicked_system).setAttribute("current-outpost", "range7");
		document.getElementById(clicked_system + "_range7").style.opacity = "0.3";
		document.getElementById(clicked_system + "_range7").style.fill = outpost_color;
	} else if (document.getElementById(clicked_system).getAttribute('current-outpost') == "range7") {
		document.getElementById(clicked_system).setAttribute("current-outpost", "range8");
		document.getElementById(clicked_system + "_range7").style.opacity = "0.0";
		document.getElementById(clicked_system + "_range8").style.opacity = "0.3";
		document.getElementById(clicked_system + "_range8").style.fill = outpost_color;
	} else if (document.getElementById(clicked_system).getAttribute('current-outpost') == "range8") {
		document.getElementById(clicked_system).setAttribute("current-outpost", "range9");
		document.getElementById(clicked_system + "_range8").style.opacity = "0.0";
		document.getElementById(clicked_system + "_range9").style.opacity = "0.3";
		document.getElementById(clicked_system + "_range9").style.fill = outpost_color;
	} else {
		document.getElementById(clicked_system).setAttribute("current-outpost", "none");
		document.getElementById(clicked_system + "_range9").style.opacity = "0.0";	
	}
}
</script>
